import { BorderAllRounded } from '@material-ui/icons';
import React from 'react';
import "../../../node_modules/bootstrap/dist/css/bootstrap.min.css";

var divStyleImg = {
    borderRadius:'10px',
};

function Carousel(props) {
    return (
        <div>
            <div id="carouselExampleIndicators" className="carousel slide container" data-ride="carousel" data-interval="1500">
                <ol className="carousel-indicators">
                    <li data-target="#carouselExampleIndicators" data-slide-to="0" className="active"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="1"></li>
                    <li data-target="#carouselExampleIndicators" data-slide-to="2"></li>
                </ol>
                <div className="carousel-inner w-880pxx">
                    <div className="carousel-item active">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/190727/1600x900" alt="First slide" />
                    </div>
                    <div className="carousel-item">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/190727/1600x900" alt="Second slide" />
                    </div>
                    <div className="carousel-item">
                        <img className="d-block w-100" style={divStyleImg} src="https://source.unsplash.com/collection/190727/1600x900" alt="Third slide" />
                    </div>
                </div>
                <a className="carousel-control-prev" href="#carouselExampleIndicators" role="button" data-slide="prev">
                    <span className="carousel-control-prev-icon" aria-hidden="true"></span>
                    <span className="sr-only">Previous</span>
                </a>
                <a className="carousel-control-next" href="#carouselExampleIndicators" role="button" data-slide="next">
                    <span className="carousel-control-next-icon" aria-hidden="true"></span>
                    <span className="sr-only">Next</span>
                </a>
            </div>
        </div>
    );
}

export default Carousel;
